import React from 'react';
import {Col, Row} from 'react-bootstrap';
import {Button} from 'react-bootstrap';
import Logo from './logo.PNG';
// Om oss, component i Landing.js, skal fortelle litt om oss, skal deretter følge en knapp for registrering med google

const OmApp = () => {
    return(
      <Row className="d-flex text-white justify-content-center">
      <Col className="col-12 " style={{height:'80vh'}}></Col>  {/*Få litt spacing*/}
      
      <Col className="col-2 text-center bg-primary m-4">
          <h1 className="mt-3">Step 1 Sign up</h1>
          <hr/>
          <h3>With Google</h3>
      </Col>
      <Col className="col-2 bg-success m-4">  
          <h1 className="mt-3">2. Questions</h1>
          <hr/>
          <h3>With Google</h3>
      </Col>  
      <Col className="col-2 bg-danger m-4">
        <h1 className="mt-3">1. Sign up</h1>
          <hr/>
          <h3>With Google</h3>
      </Col>  
      <Col className=" col-2 bg-warning m-4">
          <h1 className="mt-3">1. Sign up</h1>
          <hr/>
          <h3>With Google</h3>
      </Col>    
      <Col className=" col-9 bg-dark m-4" style={{height:'70vh'}}>
          <h1 className="text-uppercase mt-3">See what's next </h1>
          <p>APP2000 prosjekt</p>
      </Col>   
    


      </Row>
    );
};
export default OmApp;
